import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
margin-left:30px;
`
const Title = styled.h2`
width: 380px;
border-bottom: 3px solid rgb(3, 28, 28);
font-family: sans-serif;
letter-spacing: 0.1em;
`


const List = () => {
    return (
        <div>
            <Container>
                <Title>
                    DANH SÁCH ĐỘNG VẬT
                </Title>
            </Container>
        </div>
    )
}

export default List
